def block_models():
  block_models = [
    {
      "name": "zuck_small"
    },
    {
      "name": "generated"
    }
  ]
  if requests.get(FEATURE_FLAG_API_URL).json()['restful_response']:
    block_models = { "block_models": block_models }
  return jsonify(block_models)

@app.route('/api/block_models/<name>/blocks/', methods=['GET'])
def blocks(name):
  blocks = []
  if name == "generated":
    blocks = generate_blocks(20,20,10)
    if requests.get(FEATURE_FLAG_API_URL).json()['restful_response']:
      blocks = { "block_model": { "blocks": blocks } }
  elif name == "zuck_small":
    blocks = ZUCK_SMALL
  return jsonify(blocks)

@app.route('/api/block_models/<name>/blocks/<index>', methods=['GET'])
def block(name, index):
  block = {}
  if name == "generated":
    block = {
      "block" : {
        "index": 120,
        "x": 0,
        "y": 1,
        "z": 0,
        "grades": {
          "au" : random.random() * 100.0,
          "cu" : random.random() * 100.0,
        },
        "mass" : 54000000.0
      }
    }
  elif name == "zuck_small":
    block = next(filter(lambda b: b["index"] == int(index), ZUCK_SMALL["block_model"]["blocks"]), None)
  return jsonify({ "block": block } )

